import React from 'react';
import appStyles from '../../App.module.css';
import styles from './Projects.module.css';

const projects = [
  {
    title: "Portfolio Website",
    description: "A personal portfolio website built with React to showcase my projects and skills.",
    links: [
      { label: "GitHub", url: "https://github.com/yourusername/portfolio" },
      { label: "Live Demo", url: "https://yourportfolio.com" }
    ]
  },
  {
    title: "Task Manager App",
    description: "A full-stack task manager app with user authentication and real-time updates.",
    links: [
      { label: "GitHub", url: "https://github.com/yourusername/task-manager" }
    ]
  }
];

const Projects = () => (
  <section id="projects" className={appStyles.sectionWrapper}>
    <h2 className={styles.sectionTitle}>Projects</h2>
    <div className={styles.projectsGrid}>
      {projects.map((project, idx) => (
        <div key={idx} className={styles.projectCard}>
          <div className={styles.projectTitle}>{project.title}</div>
          <div className={styles.projectDesc}>{project.description}</div>
          <div className={styles.projectLinks}>
            {project.links.map((link, i) => (
              <a
                key={i}
                href={link.url}
                target="_blank"
                rel="noopener noreferrer"
                className={styles.projectLink}
              >
                {link.label}
              </a>
            ))}
          </div>
        </div>
      ))}
    </div>
  </section>
);

export default Projects;
